import React from "react";
import { Box, Grid, ThemeProvider, createTheme } from '@mui/system';
import "./KeyItem.css";

const KeyItem = (props) => {
    console.log(props);

    const theme = createTheme({
        palette: {
            dot: props.color
        }
    });

    return (
        <ThemeProvider>
            <Box id="KeyItem">
                <Grid container spacing={2} alignItems="center">
                    <Grid item xs="auto">
                        <div className="Circle" sx={{bgcolor: 'green'}}></div>
                    </Grid>
                    <Grid item xs="auto">
                        <p>{props.value}</p>
                    </Grid>
                </Grid>
            </Box>
        </ThemeProvider>
    )
}

export default KeyItem;
